import React, { useState, useEffect } from "react";
import { Button, Form, Container, Row, Col, Card } from "react-bootstrap";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import "./TradeForm.css"; // ייבוא קובץ CSS מותאם אישית

const TradeForm = ({ currentSymbol, currentPrice }) => {
  const [action, setAction] = useState("buy");
  const [quantity, setQuantity] = useState(1); // ברירת מחדל ל-1
  const [totalPrice, setTotalPrice] = useState(currentPrice);

  // עדכון המחיר הכולל בכל פעם שהכמות או המחיר משתנים
  useEffect(() => {
    setTotalPrice(quantity * currentPrice);
  }, [quantity, currentPrice]);

  const handleSubmit = (e) => {
    e.preventDefault();
    alert(
      `Action: ${action}\nSymbol: ${currentSymbol}\nQuantity: ${quantity}\nTotal Price: $${totalPrice.toFixed(
        2
      )}`
    );
  };

  const sliderSettings = {
    min: 1,
    max: 1000,
    step: 1,
    value: quantity,
    onChange: (value) => setQuantity(value),
    dots: true,
    infinite: false,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };

  return (
    <Container className="my-4">
      <Row>
        <Col lg={6} md={8} sm={12} className="mx-auto">
          <Card
            className={`trade-form-card ${
              action === "buy" ? "buy-bg" : "sell-bg"
            }`}
          >
            <Card.Body>
              <h2 className="text-center">
                {action === "buy" ? "Buy Stock" : "Sell Stock"}
              </h2>
              <Form onSubmit={handleSubmit}>
                <Form.Group className="mb-3" controlId="formCurrentSymbol">
                  <Form.Label>Symbol</Form.Label>
                  <Form.Control
                    type="text"
                    value={currentSymbol}
                    readOnly
                    className="trade-form-input"
                  />
                </Form.Group>
                <Form.Group className="mb-3" controlId="formQuantity">
                  <div className="quantity-slider-container">
                    <Slider {...sliderSettings} />
                    <div className="quantity-slider-value">{quantity}</div>
                  </div>
                </Form.Group>
                <Form.Group className="mb-3" controlId="formTotalPrice">
                  <Form.Label>Total Price</Form.Label>
                  <Form.Control
                    type="text"
                    value={`$${totalPrice.toFixed(2)}`}
                    readOnly
                    className="trade-form-input"
                  />
                </Form.Group>
                <Button
                  variant={action === "buy" ? "success" : "danger"}
                  type="submit"
                  className="w-100 trade-form-btn"
                >
                  {action === "buy" ? "Buy" : "Sell"}
                </Button>
              </Form>
            </Card.Body>
          </Card>
        </Col>
      </Row>
      <Row>
        <Col className="text-center">
          <Button
            variant="success"
            onClick={() => setAction("buy")}
            className={`me-2 trade-form-switch-btn ${
              action === "buy" ? "active" : ""
            }`}
          >
            Buy
          </Button>
          <Button
            variant="danger"
            onClick={() => setAction("sell")}
            className={`trade-form-switch-btn ${
              action === "sell" ? "active" : ""
            }`}
          >
            Sell
          </Button>
        </Col>
      </Row>
    </Container>
  );
};

export default TradeForm;
